import { MDBBtn } from 'mdb-react-ui-kit';

const AppliedFilters = () => {
    return (
        <>
            <div className="text-white">
                <small>
                    <span>Filtros aplicados:</span>
                    <MDBBtn
                        rounded
                        className="m-2 ms-0 transparentBG active"
                        color="info"
                    >
                        teste
                    </MDBBtn>
                </small>
            </div>
        </>
    );
};

export default AppliedFilters;
